import "./App.scss";
import { BrowserRouter, Navigate, Route, Routes } from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import MessageSend from "../MessageSend/MessageSend";

function App() {
  return (
    <div className="App">
      <div className="title">
        <FontAwesomeIcon icon="fa-brands fa-whatsapp fa-xl" />
      </div>
      <BrowserRouter>
        <Routes>
          <Route path="/message-send" element={<MessageSend />} />
          <Route path="*" element={<Navigate to="/message-send" />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
